import React from 'react';
import "./styles/ChannelVideoItem.css";


function ChannelVideoItem({video}) {

  return (
  <div className="videoitem__body">
    <h3>{video?.title}</h3>
    <img src={video?.thumbnails?.high?.url} alt={video?.titel} />
  </div>
  )
}

export default ChannelVideoItem;
